import Sequelize from 'sequelize';
import { sequelize } from '../database/database';

import LogMovies from './LogMovies';
import RentMovies from './RentMovies'
import SaleMovies from './SaleMovies';
import LikesMovies from './LikesMovies';

const Movies = sequelize.define('movies',{
    id: {
        type: Sequelize.INTEGER,
        primaryKey: true
    },
    title:{
        type: Sequelize.STRING
    },
    description:{
        type: Sequelize.TEXT
    },
    stock:{
        type: Sequelize.INTEGER
    },
    rentalprice:{
        type: Sequelize.DECIMAL
    },
    saleprice:{
        type: Sequelize.DECIMAL
    },
    idavailability:{
        type: Sequelize.INTEGER
    }
}, {
    timestamps: false
});

Movies.hasMany(LogMovies,{ foreignKey: 'idmovie', sourceKey: 'id' });
Movies.hasMany(RentMovies, { foreignKey: 'idmovie', sourceKey: 'id' });
Movies.hasMany(SaleMovies, { foreignKey: 'idmovie', sourceKey: 'id' });
Movies.hasMany(LikesMovies, { foreignKey: 'idmovie', sourceKey: 'id' });

export default Movies;

